import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import { Nav, Container, Card, Col } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import DropdownButton from 'react-bootstrap/DropdownButton';
import logo from '../assets/logo.png'
import avatar from '../assets/pp.png'

class NavHeader extends React.Component {
	state={
		selectedItem: '',
	}
	render() {

		return (
			<Navbar expand="lg"
					style={{fontFamily: 'Poppins', fontSize: '14px', color: '#585858', flexDirection: 'row' }}>

				<img width="155px" height="50px" src={logo} alt="" />
					<Nav.Link
						// as={Link}
						// to="/savedMeeting"
						className={
							this.state.selectedItem == 'Meetings'
								? 'navlink_active'
								: 'navlink_inactive'
						}
						onClick={() => this.setState({ selectedItem: 'Meetings' })}
					>
						<span>mainTitle</span>
					</Nav.Link>

					<Nav.Link
						// as={Link}
						to="/upcommingMeeting"
						className={
							this.state.selectedItem == 'Upcoming meeting'
								? 'navlink_active'
								: 'navlink_inactive'
						}
						onClick={() => this.setState({ selectedItem: 'Upcoming meeting' })}
					>
						<span> schedule</span>
					</Nav.Link>

					<Nav.Link
						// as={Link}
						to="/contact"
						className={
							this.state.selectedItem == 'Contact'
								? 'navlink_active'
								: 'navlink_inactive'
						}
						onClick={() => this.setState({ selectedItem: 'Contact' })}
					>
						<span> contact</span>
					</Nav.Link>

						<img width="50px" height="50px" src={avatar} alt="" />

					<Nav.Link
						// as={Link}
						onClick={() =>
							this.setState({ show: true, dropDownFlag: true })
						}
						style={{
							fontFamily: 'Poppins',
							fontSize: '14px',
							color: '#585858',
						}}
					>
						Emily
					</Nav.Link>

			</Navbar>
		);
	}
}

export default NavHeader;
